import React from 'react';
import './animations.css'; // Import the CSS file for animations

const WelcomeSection = () => {
  return (
    <section id="welcome" className="welcomesection">
      <h1 className="slide-in">Brian Alexandre</h1>
      <h2 className="slide-in">Software Engineer</h2>
      <p className="slide-in">Welcome to my space on the internet. Please take a look around!</p>
      <section className="slide-in">
        <button className="buttonFix">
          <a href="#about">
            <b>Need a Developer</b>
          </a>
        </button>
        <button className="buttonFix">
          <a href="#projects">
            <b>Need a Site</b>
          </a>
        </button>
      </section>
    </section>
  );
};

export default WelcomeSection;
